                {
                    artist_information.map((artist) => (
                        <div id={artist.id} class="col-xl-3 h-25" key={artist.id}>
                            <ArtistsCard ArtistsName={artist.name} Genre={artist.genre} />
                        </div>
                    ))
                }
            </div>
        </>
